import React from 'react';
import './App.css';
import {connect} from "react-redux";
import { actionSetName } from './ducks/playersReducer'

const App = props => {
 return (
     <div className="App">
        <div>
            <input type="text" onChange={(e) => props.actionSetName(props.name1, e.target.value)} />
        </div>
         <div>
             <input type="text" />
         </div>
     </div>
 )
};

const mapStateToProps = (state) => ({
    name1: state.players[0],
    name2: state.players[1]
});

export default connect(mapStateToProps, { actionSetName })(App);
